import React from 'react';

import './CardItem.css'

const CardItem=({Imagesrc, title, text}) => {
  return (
    <div className='CardItem'>
        <div className="card-item">
          <img src={Imagesrc} alt={title} />
          <div className="info">
            <h2>{title}</h2>
            <p>{text}</p>
          </div>
        </div>
    </div>
  );
};

export default CardItem;
